import React from 'react';
import { Link } from 'react-router-dom';
import './MyTrip.css';
import Header from '../../components/Header/Header';
import TripFull from '../../components/Trip/TripFull';
import {ReactComponent as PencilIcon} from '../../assets/Pencil_icon.svg';

export default function MyTrip() {
  return (
    <div className="my-trip">
        <Header/>
        <div className="my-trip__container">
            <div className="my-trip__container__header">
            <h2 className="my-trip__container__title">My trip</h2>
            <Link to="/edit-trip" className="my-trip__button--edit-trip button-grey"><PencilIcon /></Link>
            </div>
            <div className="my-trip__container__item">
            {/* trip items, change to dynamic */}
            <TripFull />
            </div>
        </div>
      </div>
  )
}
